var sum = function () {
    var args = Array.prototype.slice.call(arguments);
    return args.reduce(function (a, b) {
        return a + b;
    }, 0);
};
var a = sum.bind(null, 1, 2, 3);
var b = sum.bind(null, 2, 4, 6);
console.log(a(1, 2, 3) + b(2, 4, 6));

